const converToInt = (string) => {
    return parseInt(string.slice(1, string.length));
}

const getItems = () => {
    const items = [];

    newClothesEnd.forEach((clothing, index) => {
        items.push({
            ...clothing,
            price : converToInt(clothing.price),
            id : "clothing-" + index
        })
    });
    shoesEND.forEach((shoe, index) => {
        items.push({
            ...shoe,
            price : converToInt(shoe.price),
            id : "shoes-" + index
        })
    });
    hoodiesEnd.forEach((hoodie, index)=>{
        items.push({
            ...hoodie,
            price : converToInt(hoodie.price),
            id : "hoodie-" + index
        })
    });
    return items;

};

const getItem = (itemId) => {
    return getItems().find(item => item.id === itemId);
}

module.exports = {
    getItems,
    getItem
};